import {useState, useEffect} from 'react';
import React, {Component} from 'react';


class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
          loggedIn: false
      }
    }
    render () {
      return (
        <div>
          <h1>Log-In</h1>
        </div>
      );
    }
}

export default App;
